	int TriggerCharToKey( const char* Key )
	{
		if ( !strcmp( Key , CVAR_KEY_MOUSE3 ) ) return 0;
		if ( !strcmp( Key , CVAR_KEY_MOUSE4 ) ) return 1;
		if ( !strcmp( Key , CVAR_KEY_MOUSE5 ) ) return 2;

		return 0;
	}

